import React from 'react';
import Nav1 from '../components/nav1';
import Footer from '../components/footer';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <Nav1 />
      <h1>New Collection 2024</h1>
      <Link to="/search">SHOP NOW</Link>
      <h5>-----------------------------------------------------</h5>
      <h1>Catagories</h1>
      <h5>-----------------------------------------------------</h5>
      <Footer />
    </div>
  );
}

export default Home;
